//create context 
const WorkoutsContext = createContext();

//create context provider component
const WorkoutContextProvider = ({children})=>{
    return (
        <WorkoutsContext.Provider>
            {children}
        </WorkoutsContext.Provider>
    )
}

export {WorkoutsContext, WorkoutContextProvider}
